import React, { Component } from 'react'
import styled from 'styled-components'
import { Link } from 'react-router-dom'

const Header = () => {
    return (
      <Wrapper>
          <Link to="/"><HeadText>Dinner Reserver</HeadText></Link>
      </Wrapper>
    )
}
  
export default Header

const Wrapper = styled.div`
display: flex;
justify-content: center;
align-items: center;
width: 100%;
height: 70px;
background: linear-gradient(90deg, rgba(211,235,9,0.5214460784313726) 0%, rgba(199,5,5,0.6166841736694677) 52%, rgba(222,30,30,0.5102415966386555) 100%);
`;

const HeadText = styled.span`
color: #FFFFFF;
font-size: 1.5rem;
font-weight: bold;
cursor: pointer;
`;
